  `updated_by` int(11) DEFAULT NULL,
  `announcement_category_id` int(11) DEFAULT NULL,
  `is_send` int(1) DEFAULT 0 COMMENT '1 - đã gửi, 0 - chưa gửi',
  `total_apartment_send` int(11) DEFAULT 0 COMMENT 'Số căn hộ đã gửi',
  `total_apartment_open` int(11) DEFAULT 0 COMMENT 'Số căn hộ đã mở',
  PRIMARY KEY (`id`),
  KEY `idx-announcement_campaign-building_cluster_id` (`building_cluster_id`),
