ist\":[{\"uid\":\"rc-upload-1558695617207-3\",\"name\":\"11111 copy.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558769362-11111-copy.jpg\"},{\"uid\":\"rc-upload-1558695617207-5\",\"name\":\"default-apartment.png\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558769366-default-apartment.png\"}],\"fileList\":[{\"uid\":\"rc-upload-1558695617207-7\",\"name\":\"luciLogo.pdf\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558769374-lucilogo.pdf\"},{\"uid\":\"rc-upload-1558695617207-9\",\"name\":\"Simulator Screen Shot - iPhone XR - 2019-05-23 at 20.39.25.png\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558769379-simulator-screen-shot---iphone-xr---2019-05-23-at-203925.png\"},{\"uid\":\"rc-upload-1558695617207-11\",\"name\":\"11111 copy.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558769386-11111-copy.jpg\"},{\"uid\":\"rc-upload-1558695617207-13\",\"name\":\"lucibuilding-push-pro.p12\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558769390-lucibuilding-push-pro.p12\"}]}',1,NULL,NULL,NULL,1558769393,2,1558769393,1558769401,18,NULL,7,1,0,0),(32,'Thông báo cắt điện ','Thông Báo Cắt Điện\n\nNgày 08/07/2013\nKính gửi Quý Cư dân/ Dear Valued Residents!\nBan qu','<h1><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 1.57143rem;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Thông Báo Cắt Điện</span></h1>\n<p style=\"text-align:start;\"></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Ngày 08/07/2013</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Kính gửi Quý Cư dân/ Dear Valued Residents!</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Ban quản lý tòa nhà xin thông báo tới toàn thể Quý Cư dân, Quý công ty lịch cắt điện từ Công ty Điện lực GIA ĐỊNH như sau</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Please be informed that the power will be cut off as arranged from Gia Dinh Power Station as detailed followings:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Thời gian cắt điện</span> <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">:    Từ 09h00 – 14h00</span>   <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Ngày</span> <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">: 12/07/2013</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Time  </span>    <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">:  </span>  <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">09h00</span> <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">-</span> <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">14h00</span>  <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Date     </span> <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">: 12<sup>nd</sup></span> <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">July, 2013</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Trong khoảng thời gian trên hệ thống Máy phát điện dự phòng của Tòa nhà sẽ được kích hoạt đảm bảo cung cấp điện cho các hoạt động sinh hoạt, làm việc bình thường của Quý Cư dân. Tuy nhiên trong quá trình chuyển đổi, thời gian gián đoạn có thể sẽ là 20 giây. Chúng tôi lưu ý Quý Cư dân hạn chế sử dụng các thiết bị điện không cần thiết để giảm tải cho máy phát điện và đảm bảo các thiết bị điện không bị ảnh hưởng trong quá trình chuyển đổi điện đột ngột.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">During that time, the back-up generator will be run to provide full power for your normal operations &amp; work. However, during transferring to back-up generator, it will take 20 seconds for interruption. Please be noticed that you shouldn’t use unnecessary electric equipments to save power and protect them from damage because of suddenly transferring process.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Vì vậy Chúng tôi thông báo đến Quý Cư dân và rất mong nhận được thông cảm cho sự bất tiện này.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Therefore, we will appreciate for your kind corporation and be sorry for any inconveniences caused to you.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Xin kính chúc Quý Cư dân có một ngày làm việc vui vẻ./</span> <span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Wishing you a great day.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Chào trân trọng/ Yours sincerely,</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">Trưởng Ban Quản lý/ Property Manager</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(68,68,68);background-color: rgb(255,255,255);font-size: 15.996;font-family: TimesNewRoman, \"Times New Roman\", Times, Baskerville, Georgia, serif;\">NGUYEN VIET BACH</span>&nbsp;</p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558773917419-8\",\"name\":\"lang-viet-kieu-chau-au.png\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558774345-lang-viet-kieu-chau-au.png\"}],\"fileList\":[{\"uid\":\"rc-upload-1558773917419-10\",\"name\":\"[SRS - WEB] T\\u00e0i li\\u1ec7u \\u0111\\u1eb7c t\\u1ea3 ph\\u1ea7n m\\u1ec1m .docx\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558774358-srs---web-ti-liu-c-t-phn-mm.docx\"}]}',1,NULL,NULL,NULL,1558774360,1,1558774360,1558774382,6,NULL,1,1,0,0),(33,'Thông báo thu tiền dịch vụ quý 2/2019','THÔNG  BÁO\nKính gửi: Toàn thể Cư dân Khu Green House\nĐơn vị quản lý dịch vụ K','<p><strong>THÔNG  BÁO</strong></p>\n<p><em>Kính gửi</em>: <strong>Toàn thể Cư dân Khu Green House</strong></p>\n<p>Đơn vị quản lý dịch vụ Khu nhà ở chung cư cao tầng Green House xin trân trọng thông báo lịch <strong>thu tiền phí dịch vụ tháng 7 và tiền nước sạch</strong> <strong>tháng 05 năm 2016</strong> tại Khu Green House như sau:</p>\n<p>-         Thời gian thu tiền : từ 08h00 ngày 16 tháng 06 năm 2016 đến hết 18h00 ngày 26 tháng 06 năm 2016.</p>\n<p>-         Địa điểm: Phòng làm việc Bộ phận Dịch vụ Khách hàng, Tầng 1, Nhà GH4 – Khu Green House.</p>\n<p>Sau thời gian trên, nếu Cư dân chưa thanh toán tiền phí dịch vụ và tiền nước đầy đủ, Đơn vị quản lý dịch vụ sẽ tạm thời ngừng cung cấp dịch vụ đối với những Cư dân chưa thanh toán khoản phí nói trên.</p>\n<p>Mọi thắc mắc xin vui lòng liên hệ Bộ phận Dịch vụ Khách hàng qua số điện thoại: <strong>043.657.4832 / 043.657.4833 hoặc hotline 0981773330</strong></p>\n<p>Trân trọng thông báo.&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[{\"uid\":\"rc-upload-1558773917419-14\",\"name\":\"Ecogreen - HDMB.doc\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558774445-ecogreen---hdmb.doc\"}]}',1,NULL,NULL,NULL,1558774446,1,1558774446,1558774592,6,6,1,1,0,0),(34,'trdy','dfgdfg\n','<p>dfgdfg</p>\n','{\"fileImageList\":[],\"fileList\":[]}',0,NULL,NULL,NULL,1558776878,2,1558776878,1558776901,7,NULL,7,1,0,0),(35,'Thông báo kiểm tra bảo dưỡng thang máy','THÔNG BÁO\nVề việc kiểm tra và bảo dưỡng định kỳ thang máy khu Green House\nKính ','<p><strong>THÔNG BÁO</strong></p>\n<p>Về việc kiểm tra và bảo dưỡng định kỳ thang máy khu Green House</p>\n<p>Kính gửi: Toàn thể Qúy Cư dân khu nhà Green House</p>\n<p>Đơn vị quản lý và vận hành Khu chung cư cao tầng Green House trân trọng cảm ơn toàn thể quý  Cư dân đã tin tưởng và sử dụng dịch vụ của Công ty chúng tôi trong thời gian vừa qua.</p>\n<p>Để đảm bảo cho công tác vận hành hệ thống thang máy tại các tòa nhà được ổn định và an toàn, phòng ngừa các sự cố về thang máy có thể xảy ra ảnh hưởng đến đời sống sinh hoạt hàng ngày của Cư dân. Công ty CP HUDLAND Thương mại và Dịch vụ phối hợp cùng đơn vị nhà thầu tiến hành kiểm tra và bảo dưỡng định kỳ thang máy tháng 6  năm 2018. Trong quá trình kiểm tra và bảo dưỡng thang máy Đơn vị dịch vụ sẽ tiến hành cắt luân phiên các thang máy của các tòa nhà. Thời gian tạm ngừng thang máy cụ thể như sau:</p>\n<p>Tòa nhà GH3: Sáng 8h00-11h 00, chiều 13h30 đến 17h30 ngày 18 tháng 06 năm 2018</p>\n<p>Tòa nhà GH4: Sáng 8h00-11h 00, chiều 13h30 đến 17h30 ngày 18 tháng 06 năm 2018</p>\n<p>Tòa nhà GH5: Sáng 8h00-11h 00, chiều 13h30 đến 17h30 ngày 19 tháng 06 năm 2018</p>\n<p>Tòa nhà GH6: Sáng 8h00-11h 00, chiều 13h30 đến 17h30 ngày 19 tháng 06 năm 2018</p>\n<p>Trong quá trình tiến hành kiểm tra và bỏa dưỡng có thể làm ảnh hưởng đến đời sống sinh hoạt hàng ngày của Qúy Cư dân. Đơn vị quản lý vận hành rất mong nhận được sự hợp tác và thông cảm của toàn thể Qúy Cư dân</p>\n<p>Mọi sự đóng góp, thắc mắc của Qúy Cư dân xin vui lòng liên hệ đến số điện thoại: 02436574833 hoặc hotline: 0981 773 330.</p>\n<p>Trân trọng thông báo!&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558777034,1,1558777034,1558777764,20,NULL,1,1,1,0),(36,'Demo giải pháp Cư dân thông minh','Kính thưa toàn thể cư dân Seasons Avenue\nThuật ngữ “công nghệ 4.0” đang là chủ','<p><strong>Kính thưa toàn thể cư dân Seasons Avenue</strong></p>\n<p>Thuật ngữ “công nghệ 4.0” đang là chủ đề được quan tâm đặc biệt trong thời gian gần đây. Công nghệ 4.0 là xu hướng ứng dụng trong tương lai và dần được ứng dụng mạnh mẽ để thay thế nguồn nhân lực làm việc bằng tay chân thông thường. Quản lý tòa nhà không nằm ngoài trong xu hướng ấy, với sự phát triển vượt bậc trong thời gian gần đây, công nghệ 4.0 đang từng bước được đưa vào công tác quản lý vận hành tòa nhà, giúp quá trình quản lý đạt hiệu quả và chất lượng cao nhất.</p>\n<p>BQT lâm thời chung cư Seasons Avenue kính mời toàn thể cư dân tới dự buổi giới thiệu phần mềm quản lý chung cư để có những đánh giá khách quan nhất về các phần mềm quản lý này.</p>\n<p>Thời gian: 20h ngày 25/05/2019</p>\n<p>Địa điểm: Phòng cộng đồng chung cư Seasons Avenue</p>\n<p>Nhằm mục đích đánh giá chất lượng phần mềm quản lý tòa nhà, BQT lâm thời quyết định thành lập tiểu ban IT là các cư dân Seasons Avenue có kiến thức và đang hoạt động trong lĩnh vực công nghệ thông tin giúp tổng hợp, đánh giá và xin ý kiến cư dân về các phần mềm quản lý chung cư được giới thiệu.</p>\n<p><em>(Chị tiết cụ thể mời quý cư dân xem thư mời và quyết định đính kèm)</em></p>\n<p><strong>Rất mong chờ sự có mặt và những đóng góp tích cực từ quý cư dân!</strong></p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558776024646-5\",\"name\":\"SA.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558776522-sa.jpg\"}],\"fileList\":[]}',1,NULL,NULL,NULL,1558777133,1,1558777133,1558777764,1,NULL,1,1,0,0),(37,'THÔNG BÁO VỀ VIỆC PHUN CÔN TRÙNG ĐỊNH KỲ','THÔNG BÁO\nVề việc phun côn trùng định kỳ\nKính gửi: Toàn thể Cư dân Khu Green Ho','<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>THÔNG BÁO</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Về việc phun côn trùng định kỳ</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Kính gửi: Toàn thể Cư dân Khu Green House</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Đơn vị quản lý dịch vụ Khu chung cư cao tầng Green House xin trân trọng thông báo tới toàn thể Qúy Cư dân lịch phun côn trùng định kỳ tháng 05/2018 như sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">1. Phun tồn lưu</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Ngày 10 tháng 05 năm 2018</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Khu vực xử lý: Khu vực công cộng, sân vườn</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Thời gian: Sáng 8h30 – 11h30 chiều: 14h00 đến 15h00</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Yêu cầu: Rời khỏi khu vực xử lý và có thể trở lại sau 01 giờ thực hiện</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">2. Phun mù và phun khói</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Ngày 10 tháng 05 năm 2018</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Khu vự xử lý: Khu vực công cộng, sân vườn</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Thời gian: Chiều: 14h00 đến 17h00</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Yêu cầu: Rời khỏi khu vực xử lý và có thể trở lại sau 01 giờ thực hiện</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">3. Kiểm tra và xử lý bả chuột</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Ngày 10 tháng 05 năm 2018</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Khu vự xử lý: Khu vực công cộng, sân vườn</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">- Thời gian: Chiều: 14h00 đến 17h00</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Tùy vào điều kiện thời tiết, nếu điều kiện thời tiết không thuận lợi thì Đơn vị quản lý sẽ lùi lịch phun đến khi thời tiết thuận lợi</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Việc xử lý không gây độc hại với trẻ em, vật nuôi nhưng Đơn vị quản lý dịch vụ khuyến cáo Qúy Cư dân không nên tiếp xúc trực tiếp với khu vực xử lý trong vòng 01 giờ</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Mọi câu hỏi thắc mắc xin vui lòng liên hệ Bộ phận Dịch vụ Khách hàng qua số điện thoại: 0243 .657.4832 hoặc hotline dịch vụ khách hàng: 0981 773 330 để được xử lý kịp thời</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Trân trọng thông báo!</span>&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558777531,1,1558777531,1559002098,20,23,9,1,10,1),(38,'Lực : Gửi phản phản hồi','Đây là nội dung\n','<p>Đây là nội dung</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558777563,1,1558777563,1558951528,1,18,10,1,2,1),(39,'THÔNG BÁO VỀ VIỆC TĂNG CƯỜNG CÔNG TÁC ĐỀ CAO CẢNH GIÁC PHÒNG CHỐNG TỘI PHẠM DỊP WORLD CUP 2018','THÔNG BÁO\nVề việc tăng cường công tác đề cao cảnh giác phòng chống tội phạm','<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>THÔNG BÁO</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Về việc tăng cường công tác đề cao cảnh giác phòng chống tội phạm</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Hiện nay đang là thời điểm diễn ra giải bóng đá thế giới  World Cup 2018 nên tình hình tội phạm có chiều hướng gia tăng. Để hạn chế các tác động xấu từ bên ngoài đến con người và tài sản của Cư dân Khu Green House – CT17, Công ty Cổ phần HUDLAD Thương  mại và Dịch vụ kính mong Qúy Cư dân một số vấn đề sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">1. Qúy Cư dân chủ động nâng cao cảnh giác, tự bảo quản tài sản</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">2. Kiểm tra các khóa cửa căn hộ trước khi ra khỏi nhà</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">3. Khi nhà không có người ở hay đi công tác trong thời gian dài, cần thông báo cho Đơn vị Dịch vụ Khu Chung cư Green House hoặc hàng xóm</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">4. Đối với các tài sản cá nhân có giá trị lớn như: Xe máy, ô tô cần chủ động gửi tại các bãi xe có người trông giữ đảm bảo</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">5. Không đậu đỗ xe tại các vị trí không có lực lượng trông giữ</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">6. Bộ phận an ninh cần tăng cường tuần tra, kiểm tra các hiện tượng nghi vấn, quản lý Khách đến khu chung cư, tránh để kẻ gian trà trộn gây ảnh hưởng đến an ninh trật trự chung của Khu.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Rất mong toàn thể Qúy Cư dân hợp tác cùng Đơn vị dịch vụ – Công ty CP HUDLAND Thương mại và Dịch vụ – chủ động phòng chống trộm cắp, tệ nạn xã hội trong thời gian này</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Mọi sự đóng góp ý kiến của Qúy Cư dân xin vui lòng liên hệ</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Phòng Dịch vụ Khách hàng Tầng 1 – GH4. SĐT: 024.3657.4833/ 024.3657.4832 hoặc hotline 0981 773 330.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Trân trọng thông báo!</span>&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558777600,1,1558777600,1558777764,20,NULL,9,1,10,0),(40,'THÔNG BÁO LỊCH TRỰC NGHỈ LỄ NGÀY 30/04 VÀ NGÀY 01/05/2018','THÔNG BÁO\nVề việc lịch trực nghỉ lễ 30/04 và 01/05/2018\nKính gửi: Toàn thể Qúy','<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>THÔNG BÁO</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Về việc lịch trực nghỉ lễ 30/04 và 01/05/2018</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Kính gửi: Toàn thể Qúy Cư dân Khu chung cư cao tầng Green House</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Đơn vị quản lý và vận hành khu chung cư cao tầng Green House trân trọng cảm ơn toàn thể Qúy Cư dân đã tin tưởng và sử dụng dịch vụ của Công ty Cổ phần HUDLAND Thương mại và Dịch vụ trong thời gian vừa qua.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Nhằm đảm bảo cho công tác quản lý và vận hành khu chung cư cao tầng Green House trong thời gian nghỉ lễ 30/04 và 01/05 được an toàn và hiệu quả. Đồng thời đảm bảo việc nghỉ lễ cho các phòng ban và bộ phận trong công ty theo đúng Quy định của Nhà nước. Công ty Cổ phần HUDLAND Thương mại và Dịch vụ xin phép được thông báo tới toàn thể Qúy Cư dân về lịch trực nghỉ lễ của Ban quản lý CT17 như sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Thời gian trực: Ngày 30/04/2018 và 01/05/2018.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Mọi sự đóng góp ý kiến của Qúy Cư dân vui lòng liên hệ Bộ phận Dịch vụ Khách hàng tại tầng 1 tòa nhà GH4 hoặc qua số điện thoai 0243 657 4832/ 0243 657 4833 hoặc hotline 0981 773 330 để được xử lý kịp thời.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Trân trọng thông báo!</span>&nbsp;</p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558777635380-9\",\"name\":\"lang-viet-kieu-chau-au.png\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558777914-lang-viet-kieu-chau-au.png\"}],\"fileList\":[]}',1,NULL,NULL,NULL,1558777920,1,1558777920,1559002064,20,23,1,1,10,1),(41,'THÔNG BÁO VỀ VIỆC THAU RỬA HỆ THỐNG BỂ NƯỚC SINH HOẠT ĐỊNH KỲ','THÔNG BÁO\nVề việc thau rửa hệ thống bể nước sinh hoạt định kỳ\nKính gửi: T','<p><strong>THÔNG BÁO</strong></p>\n<p><strong>Về việc thau rửa hệ thống bể nước sinh hoạt định kỳ</strong></p>\n<p><strong>Kính gửi:</strong> <strong>Toàn thể Qúy Cư dân khu nhà Green House</strong></p>\n<p>- Căn cứ vào Kế hoạch thau rửa hệ thống bể nước sinh hoạt định kỳ năm 2018 của đơn vị quản lý và vận hành dịch vụ Cụm chung cư Green House.</p>\n<p>Đơn vị quản lý và vận hành Khu chung cư Green House trân trọng cảm ơn toàn thể Qúy Cư dân đã tin tưởng và sử dụng dịch vụ của Công tu HUDLANDTS Trong thời gian vừa qua.</p>\n<p>Thực hiện kế hoạch trong công tác quản lý vận hành, Đơn vị quản lý và vận hành khu Chung cư cao tầng Green House trân trọng thông báo tới toàn thể Qúy cư dân về lịch trình thau rửa bể nước sinh hoạt các tòa nhà GH1, GH2, GH3, GH4 GH5, GH6 với nội dung cụ thể như sau:</p>\n<p><strong>Thời gian thau rửa bể ngầm                                     Thời gian thau rửa bể mái </strong></p>\n<p>GH1: 7H00 đến 15h00 ngày 7/5/18                            8H30 đến 11h00 ngày 9/5/18</p>\n<p>GH2: 7H00 đến 15h00 ngày 11/5/18                          8H30 đến 11h00 ngày 13/5/18</p>\n<p>GH3: 7H00 đến 15h00 ngày 27/4/18                         8H30 đến 11h00 ngày 30/4/18</p>\n<p>GH4: 7H00 đến 15h00 ngày 02/5/18                         8H30 đến 11h00 ngày 4/5/18</p>\n<p>GH5: 7H00 đến 15h00 ngày 18/4/18                          8H30 đến 11h00 ngày 23/04/18</p>\n<p>GH6: 7H00 đến 15h00 ngày 26/4/18                        8H30 đến 11h00 ngày 26/04/18</p>\n<p>2. Thành phần tham gia</p>\n<p>- Đơn vị thực hiện thau rửa bể: Bộ phận kỹ thuật Công ty Cổ phần HUDLAND Thương mại và Dịch vụ</p>\n<p>- Giám sát và nghiệm thu quá trình thực hiện: Đại diện Ban quản trị, đại diện Tổ dân phố, đại diện Cư dân từng tòa nhà.</p>\n<p>Trong thời gian thau rửa bể việc cung cấp nước sinh hoạt tới các hộ Cư dân sẽ bị gián đoạn và có thể gây ảnh hưởng đến sinh hoạt hàng ngày của Qúy Cư dân. Rất mong nhận được sự chia sẻ và hợp tác từ phía Cư dân. Đồng thời để quá trình thực hiện khách quan và minh bạch, đề nghị các thành phần tham gia giám sát và nghiệm thu quá trình thực hiện có mặt đúng thời gian và địa điểm đã nêu trên.</p>\n<p>Mọi sự đóng góp ý kiến của Qúy Cư dân xin liên hệ tới Bộ phận Dịch vụ Khách hàng tại tầng 1 tòa nhà GH4 hoặc liên hệ qua số điện thoại: 043 657 4833/ 043 657 4832, hotline Dịch vụ Khách hàng: 0981 773 330</p>\n<p><strong>Trân trọng thông báo!</strong>&nbsp;</p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558778018126-5\",\"name\":\"20190408112444-c52a_wm.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558778085-20190408112444-c52a_wm.jpg\"},{\"uid\":\"rc-upload-1558778018126-7\",\"name\":\"20190408112444-55a3_wm.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558778089-20190408112444-55a3_wm.jpg\"}],\"fileList\":[{\"uid\":\"rc-upload-1558778018126-9\",\"name\":\"Luci Building.docx\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558778111-luci-building.docx\"}]}',1,NULL,NULL,NULL,1558778114,1,1558778114,1558778161,20,NULL,9,1,10,0),(42,'Thông báo mất điện 25/05/2019','......','<p>Điện luôn là nhu cầu không thể thiếu trong đời sống sinh hoạt thường ngày của chúng ta. Bởi vậy nếu đột xuất mất điện mà không biết trước chắc chắc sẽ khiến chúng ta bị lỡ dỡ nhiều công việc. Vì thế ChanhTuoi.com xin gửi đến mọi người bảng tổng hợp các thông báo lịch cắt điện Hà Nội trên toàn địa bàn thành phố.</p>\n<p>Hàng ngày, hàng tuần chúng tôi sẽ cập nhật đầy đủ chi tiết các thông báo tạm ngừng cấp điện các quận huyện trên địa bàn toàn thành phố của điện lực Hà Nội nhanh nhất, chính xác nhất để chuyển đến các bạn. Sau đây sẽ là thông báo lịch cắt điện từ ngày ngày 01/5 đến hết ngày 31/5/2019 của công ty điện lực Hà Nội trên toàn khu vực thành phố để phục vụ công tác sữa chữa, nâng cấp lưới điện.&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558779214,2,1558779214,1558779241,7,NULL,7,1,0,0),(43,'Thông báo lịch cắt điện Hà Nội từ 01/5 đến 31/5/2019','......','<p><span style=\"color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 16px;font-family: TeXGyreAdventor, Arial, sans-serif;\">Điện luôn là nhu cầu không thể thiếu trong đời sống sinh hoạt thường ngày của chúng ta. Bởi vậy nếu đột xuất mất điện mà không biết trước chắc chắc sẽ khiến chúng ta bị lỡ dỡ nhiều công việc. Vì thế</span> <strong>ChanhTuoi.com</strong> <span style=\"color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 16px;font-family: TeXGyreAdventor, Arial, sans-serif;\">xin gửi đến mọi người bảng tổng hợp các</span> <strong>thông báo lịch cắt điện Hà Nội</strong> <span style=\"color: rgb(0,0,0);background-color: rgb(255,255,255);font-size: 16px;font-family: TeXGyreAdventor, Arial, sans-serif;\">trên toàn địa bàn thành phố.</span>&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558779446,1,1558779446,1558951523,1,18,10,1,2,1),(44,'THÔNG BÁO LỊCH THU TIỀN NƯỚC THÁNG 06 NĂM 2019','THÔNG BÁO\nSố: 224/08/ TB- HUDLANDTS\nV/v thu tiền nước tháng 06 năm 2014\nKính gửi:...','<h2 style=\"text-align:center;\"><span style=\"color: rgb(29,29,29);background-color: transparent;font-size: 18px;font-family: Sylfaen;\"><strong>THÔNG BÁO</strong></span></h2>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Số</strong>: 224/08/ TB- HUDLANDTS</span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><em>V/v thu tiền nước tháng 06 năm 2014</em></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><em>Kính gửi:</em></span> <span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Toàn bộ Cư dân Khu Green House</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Đơn vị quản lý dịch vụ Khu nhà ở chung cư cao tầng Green House xin trân trọng thông báo lịch thu tiền nước sạch tháng 06 năm 2014 tại Khu Green House như sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">- Thời gian thu tiền nước tháng 06: từ 08h00 ngày 12 tháng 08 năm 2014 đến hết 18h00 ngày 25 tháng 08 năm 2014.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">- Địa điểm: Phòng làm việc Bộ phận Dịch vụ Khách hàng, Tầng 1, Nhà GH4 – Khu Green House.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">- Sau thời gian trên, nếu Cư dân chưa đóng đầy đủ tiền nước, Đơn vị quản lý dịch vụ sẽ tạm thời ngừng cung cấp nước.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Mọi thắc mắc xin vui lòng liên hệ Bộ phận Dịch vụ Khách hàng qua số điện thoại: 043.675.4832 / 043.657.4833</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Trân trọng thông báo.</span></p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558780618736-3\",\"name\":\"lang-viet-kieu-chau-au.png\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558780948-lang-viet-kieu-chau-au.png\"}],\"fileList\":[{\"uid\":\"rc-upload-1558780618736-5\",\"name\":\"[SRS - WEB] T\\u00e0i li\\u1ec7u \\u0111\\u1eb7c t\\u1ea3 ph\\u1ea7n m\\u1ec1m .docx\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558780944-srs---web-ti-liu-c-t-phn-mm.docx\"}]}',1,NULL,NULL,NULL,1558780950,1,1558780950,1558780981,20,NULL,9,1,0,0),(45,'THÔNG BÁO (LẦN 2) VỀ VIỆC CHẬM THANH TOÁN KHOẢN PHÍ QUẢN LÝ TÒA NHÀ THÁNG 01 NĂM 2017 VÀ TIỀN NƯỚC SINH HOẠT THÁNG 11 NĂM 2016','THÔNG BÁO (LẦN 2)\nVề việc thanh toán khoản phí quản lý tòa nhà tháng 1 năm 2017...','<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>THÔNG BÁO (LẦN 2)</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Về việc thanh toán khoản phí quản lý tòa nhà tháng 1 năm 2017 và tiền nước sinh hoạt tháng 11 năm 2016</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Kính gửi: Qúy Cư dân khu Green House</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Đơn vị quản lý vận hành khu chung cư cao tầng Green House trân trọng cảm ơn toàn thể Qúy Cư dân đã phối hợp cùng Đơn vụ quản lý hoàn thành công tác quản lý và vận hành Khu chung cư cao tầng Green House trong thời gian vừa qua.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Công ty Cổ phần Hudland Thương mại và Dịch vụ xin thông báo tới những căn hộ chưa thanh toán phí quản lý vận hành nhà chung cư (phí dịch vụ) tháng 1 năm 2017 và tiền nước sinh hoạt tháng 11 năm 2016.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Sau khi đã thông báo đến các căn hộ về việc chưa thanh toán phí quản lý và vận hành nhà chung cư tháng 1 năm 2017 và tiền nước sinh hoạt tháng 11 đến nay ngày 26/12/2016 phòng Dịch vụ tiếp tục thông báo tới Qúy Cư dân thanh toán khoản phí nói trên cho Công ty Cổ phần Hudland Thương mại và Dịch vụ trong vòng 5 ngày kể từ ngày nhận thông báo này. Tiền phí có thể thanh toán bằng tiền mặt hoặc chuyển khoản, chi tiết như sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Tiền mặt</strong>: Nộp trực tiếp BP-DVKH  - Tầng 1, tòa nhà GH4</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Chuyển khoản: </strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">- Tên đơn vị thụ hưởng: Công ty Cổ phần Hudland Thương mại và Dịch vụ</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">- Số TK: 15110000164535</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">- Ngân hàng: BIDV chi nhánh Thành Đô</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">- Nội dung: Ghi rõ tên, địa chỉ người nộp phí và loại phí</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Sau thời hạn trên, các căn hộ không thực hiện việc thanh toán khoản phí nói trên thì Công ty Cổ phần Hudland Thương mại và Dịch vụ sẽ tiến hành ngừng cung cấp các dịch vụ cho đến khi Chủ căn hộ thực hiện thanh toán các khoản phí nói trên.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Đơn vị quản lý và vận hành Khu nhà ở chung cư cao tầng Green House rất mong sự hợp tác của toàn thể Qúy Cư dân. Mọi đóng góp ý kiến xin vui lòng liên hệ tới Bộ phận Dịch vụ Khách hàng tại tầng 1 tòa nhà GH4 hoặc liên hệ qua số điện thoại: 043 657 4833/ 043 657 4832 hoặc liên hệ qua số hotline 0981 773 330.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Trân trọng thông báo!</span></p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558781084,1,1558781084,1558781101,20,NULL,1,1,1,0),(46,'THÔNG BÁO VỀ VIỆC ĐỂ XE TRONG LÒNG ĐƯỜNG NỘI BỘ TRÁNH THIỆT HẠI DO BÃO','THÔNG BÁO\n(Về việc để xe trong lòng đường nội bộ tránh thiệt hại do...','<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>THÔNG BÁO</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong><em>(Về việc để xe trong lòng đường nội bộ tránh thiệt hại do bão)</em></strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Đơn vị Quản lý vận hành Chung cư cao tầng Green House trân trọng cảm ơn toàn thể Qúy Cư dân đã tin tưởng và sử dụng dịch vụ của Công ty Cổ phần HUDLAND Thương mại và Dịch vụ trong thời gian vừa qua.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Để đối phó với tình hình mưa bão và đặc biệt là cơn bão số 3 đang tiến vào đất liền. Do ảnh hưởng của hoàn lưu bão, từ chiều tối nay ngày 18 tháng 08 năm 2016 khu vực Hà Nội sẽ có gió mạnh và mưa rất to. Để tránh tình trạng thiệt hại về tài sản cho Cư dân Khu Chung cư cao tầng Green House, Đơn vị Quản lý Dịch vụ đề nghị Qúy Cư dân đang gửi xe đang gửi xe tại bãi xe ngoài trời phối hợp với Đơn vị dịch vụ và dưới sự hướng dẫn của Bảo vệ để đỗ xe trong lòng đường nội bộ trong thời gian cơn bão đi qua. Qúy cư dân lưu ý khi đỗ xe trong lòng đường nội bộ, tránh các vị trí có cây to, khu vực đường cong và đảm bảo công tác phân luồng giao thông. Sau cơn bão đề nghị Qúy Cư dân cho xe về đúng bão xe đã đăng ký với Đơn vị Dịch vụ.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Mọi sự đóng góp ý kiến xin vui lòng liên hệ bộ phận Dịch vụ Khách hàng tại tầng 1 tòa nhà GH4 hoặc liên hệ số điện thoại: 04.3657.4833/04.3657.4832 hoặc hotline tại Bộ phận Dịch vụ Khách hàng 0981 773 330/ Bộ phận Kỹ thuật 0981 773 331 để được xử lý kịp thời.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Trân trọng thông báo!</span></p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558781163,1,1558781163,1558781222,20,NULL,1,1,0,0),(47,'Thong bao test','s\n','<p>s</p>\n','{\"fileImageList\":[],\"fileList\":[]}',0,NULL,NULL,NULL,1558781703,2,1558781703,1558781761,18,NULL,5,1,0,0),(48,'Highcharts Anootations Demo','Test\n','<p>Test</p>\n','{\"fileImageList\":[],\"fileList\":[]}',0,NULL,NULL,NULL,1558782380,2,1558782380,1558782422,18,NULL,2,1,0,0),(49,'ASDS','ss\n','<p>ss</p>\n','{\"fileImageList\":[],\"fileList\":[]}',0,NULL,NULL,NULL,1558782422,2,1558782422,1559032551,18,15,5,1,5,5),(50,'THÔNG BÁO LỊCH ĐĂNG KÝ THẺ XE THÁNG 09 NĂM 2019','THÔNG BÁO\nSố: 223/08/ TB-HUDLANDTS\nV/v đăng ký thẻ xe tháng 09 năm 2014\nKính gửi:...','<h2 style=\"text-align:center;\"><span style=\"color: rgb(29,29,29);background-color: transparent;font-size: 18px;font-family: Sylfaen;\"><strong>THÔNG BÁO</strong></span></h2>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Số</strong>: 223/08/ TB-HUDLANDTS</span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><em>V/v đăng ký thẻ xe tháng 09 năm 2014</em></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><em>Kính gửi:</em></span> <span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Toàn thể Cư dân Khu Green House</strong></span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Đơn vị quản lý dịch vụ Khu nhà ở chung cư cao tầng Green House xin trân trọng thông báo tới toàn thể Cư dân lịch đăng ký thẻ xe tháng 8 năm 2014 như sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">1. Thời gian tiếp nhận đăng ký: từ 08h00 ngày 15 tháng 08 năm 2014 đến hết 18h00 ngày 25 tháng 08 năm 2014.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">2. Nơi tiếp nhận đăng ký và trả thẻ: Bộ phận Dịch vụ Khách hàng, Tầng 1, Nhà GH4, Khu Green House.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">3. Thời gian trả thẻ: từ 08h00 ngày 27 tháng 08 năm 2014 đến hết 18h00 ngày 29 tháng 08 năm 2014.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">4. Thời gian tiếp nhận đăng ký thẻ xe tháng 10/2014: từ ngày 13 đến ngày 23 tháng 09 năm 2014.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Trân trọng cảm ơn sự hợp tác của Quý Cư dân.</span></p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558782155464-15\",\"name\":\"lang-viet-kieu-chau-au2x (2).png\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558782464-lang-viet-kieu-chau-au2x-2.png\"}],\"fileList\":[{\"uid\":\"rc-upload-1558782155464-17\",\"name\":\"Tr\\u01b0\\u1eddng-h\\u1ecdc-th\\u00f4ng-minh-Tr\\u01b0\\u1eddng-THPT-L\\u00ea-Danh-Ph\\u01b0\\u01a1ng-I.docx\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558782475-trng-hc-thng-minh-trng-thpt-l-danh-phng-i.docx\"}]}',1,NULL,NULL,NULL,1558782478,1,1558782478,1558782481,20,NULL,1,1,1,0),(51,'DIỄN TẬP PHƯƠNG ÁN CHỮ CHÁY VÀ CỨU NẠN CỨU HỘ TẠI KHU CHUNG CƯ GREEN HOUSE – CT 17','\n\nNgày 26/11/2016 Theo kế hoạch diễn tập phòng cháy chữa cháy do sở cảnh sát...','<p style=\"text-align:justify;\"></p>\n<img src=\"http://www.green-house.com.vn/vi/wp-content/uploads/2016/11/IMG_5593-700x525.jpg\" alt=\"\" style=\"float:none;height: auto;width: \"/>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Ngày 26/11/2016 Theo kế hoạch diễn tập phòng cháy chữa cháy do sở cảnh sát PCCC – đội PCCC số 4, lãnh đạo công ty đã chỉ đạo chung công ty thực hiện phối hợp kế hoạch diễn tập PCCC với sở cảnh sát PCCC và đội PCCC số 4 Đây là hoạt động thường niên nhằm mục đích nâng cao ý thức về công tác PCCC của toàn thể cán bộ nhân viên Công ty và toàn bộ cư dân khu Green House. Hoạt động này có ý nghĩa quan trọng trong việc giúp mọi người nắm bắt được các kỹ năng, quy trình phối hợp và triển khai chữa cháy, biết cách sử dụng thành thạo các thiết bị chữa cháy, khả năng cứu hộ, thoát nạn khi có sự cố cháy nổ xảy ra. Tham gia diễn tập có hơn 30 cán bộ công nhân viên và các cư dân Khu chung cư Green House và hơn 30 nhân viên và các chiến sỹ thuộc lực lượng Cảnh sát PCCC.</span></p>\n<p style=\"text-align:justify;\"></p>\n<img src=\"http://www.green-house.com.vn/vi/wp-content/uploads/2016/11/IMG_5647-700x525.jpg\" alt=\"\" style=\"float:none;height: auto;width: \"/>\n<img src=\"http://www.green-house.com.vn/vi/wp-content/uploads/2016/11/IMG_5640-700x525.jpg\" alt=\"\" style=\"float:none;height: auto;width: \"/>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Đợt diễn tập lần này thực hiện giả định vụ cháy xảy ra tại khu Chung cư. Khi có thông báo cháy, cán bộ thực hiện việc chữa cháy, cứu nạn cứu hộ và thoát nạn đúng quy trình đặt ra theo kịch bản diễn tập.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\">Tình huống giả định: lúc 9h00 sáng ngày 26/11/2016, xảy ra vụ cháy tại tầng 3 tòa nhà GH5  khả năng phát triển của đám cháy là cháy lan từ khu vực này sang khu vực xung quanh với nhiều vật liệu dễ cháy nổ như xe oto , xăng dầu nhớt , khả năng kẹt người trong đám cháy là rất lớn, đe dọa tính mạng của các cán bộ và nhân viên và cư dân đang sinh sống tại Khu chung cư</span></p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558782633,1,1558782633,1558782648,20,NULL,1,1,0,0),(52,'DIỄN TẬP PHƯƠNG ÁN CHỮ CHÁY VÀ CỨU NẠN CỨU HỘ TẠI KHU CHUNG CƯ GREEN HOUSE – CT 17','\n\nNgày 26/11/2016 Theo kế hoạch diễn tập phòng cháy chữa cháy do sở cảnh sát...','<p>Ngày 26/11/2016 Theo kế hoạch diễn tập phòng cháy chữa cháy do sở cảnh sát PCCC – đội PCCC số 4, lãnh đạo công ty đã chỉ đạo chung công ty thực hiện phối hợp kế hoạch diễn tập PCCC với sở cảnh sát PCCC và đội PCCC số 4 Đây là hoạt động thường niên nhằm mục đích nâng cao ý thức về công tác PCCC của toàn thể cán bộ nhân viên Công ty và toàn bộ cư dân khu Green House. Hoạt động này có ý nghĩa quan trọng trong việc giúp mọi người nắm bắt được các kỹ năng, quy trình phối hợp và triển khai chữa cháy, biết cách sử dụng thành thạo các thiết bị chữa cháy, khả năng cứu hộ, thoát nạn khi có sự cố cháy nổ xảy ra. Tham gia diễn tập có hơn 30 cán bộ công nhân viên và các cư dân Khu chung cư Green House và hơn 30 nhân viên và các chiến sỹ thuộc lực lượng Cảnh sát PCCC</p>\n<p>Đợt diễn tập lần này thực hiện giả định vụ cháy xảy ra tại khu Chung cư. Khi có thông báo cháy, cán bộ thực hiện việc chữa cháy, cứu nạn cứu hộ và thoát nạn đúng quy trình đặt ra theo kịch bản diễn tập.</p>\n<p>Tình huống giả định: lúc 9h00 sáng ngày 26/11/2016, xảy ra vụ cháy tại tầng 3 tòa nhà GH5  khả năng phát triển của đám cháy là cháy lan từ khu vực này sang khu vực xung quanh với nhiều vật liệu dễ cháy nổ như xe oto , xăng dầu nhớt , khả năng kẹt người trong đám cháy là rất lớn, đe dọa tính mạng của các cán bộ và nhân viên và cư dân đang sinh sống tại Khu chung cư</p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558782933961-5\",\"name\":\"IMG_5730-700x525.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558783310-img_5730-700x525.jpg\"},{\"uid\":\"rc-upload-1558782933961-7\",\"name\":\"IMG_5761-700x525.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558783313-img_5761-700x525.jpg\"}],\"fileList\":[]}',1,NULL,NULL,NULL,1558782831,1,1558782831,1559060565,20,9,1,1,27,1),(53,'Demo Giải pháp Cư dân 4.0','Kính thưa toàn thể cư dân Seasons Avenue!\nThuật ngữ công nghệ 4.0 đang là chủ...','<p><strong>Kính thưa toàn thể cư dân Seasons Avenue!</strong></p>\n<p>Thuật ngữ công nghệ 4.0 đang là chủ đề được quan tâm đặc biệt trong thời gian gần đây. Công nghệ 4.0 là xu hướng ứng dụng trong tương lai và dần được ứng dụng mạnh mẽ để thay thế nguồn nhân lực làm việc bằng tay chân thông thường. Quản lý tòa nhà không nằm ngoài trong xu hướng ấy, với sự phát triển vượt bậc trong thời gian gần đây, công nghệ 4.0 đang từng bước được đưa vào công tác quản lý vận hành tòa nhà, giúp quá trình quản lý đạt hiệu quả và chất lượng cao nhất.</p>\n<p>BQT lâm thời chung cư Seasons Avenue kính mời toàn thể cư dân tới dự buổi giới thiệu phần mềm quản lý chung cư để có những đánh giá khách quan nhất về các phần mềm quản lý này.</p>\n<p>Thời gian: 20h ngày 25/05/2019</p>\n<p>Địa điểm: Phòng cộng đồng chung cư Seasons Avenue</p>\n<p>Nhằm mục đích đánh giá chất lượng phần mềm quản lý tòa nhà, BQT lâm thời quyết định thành lập tiểu ban IT là các cư dân Seasons Avenue có kiến thức và đang hoạt động trong lĩnh vực công nghệ thông tin giúp tổng hợp, đánh giá và xin ý kiến cư dân về các phần mềm quản lý chung cư được giới thiệu.</p>\n<p><em>(Chị tiết cụ thể mời quý cư dân xem thư mời và quyết định đính kèm)</em></p>\n<p><strong>Rất mong chờ sự có mặt và những đóng góp tích cực từ quý cư dân!</strong></p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1558782463849-10\",\"name\":\"SA.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558784021-sa.jpg\"},{\"uid\":\"rc-upload-1558782463849-16\",\"name\":\"SA1.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1558784119-sa1.jpg\"}],\"fileList\":[{\"uid\":\"rc-upload-1558782463849-22\",\"name\":\"SA pdf.pdf\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1558784203-sa-pdf.pdf\"}]}',1,NULL,NULL,NULL,1558784042,1,1558784042,1559047957,1,9,1,1,35,2),(54,'Thông báo thu tiền 05/2019','THÔNG  BÁO\nKính gửi: Toàn thể Cư dân Season Avenue\nĐơn vị quản lý dịch vụ Khu...','<p>THÔNG  BÁO</p>\n<p>Kính gửi: Toàn thể Cư dân Season Avenue</p>\n<p>Đơn vị quản lý dịch vụ Khu nhà ở chung cư Season Avenue xin trân trọng thông báo lịch thu tiền phí dịch vụ tháng 7 và tiền nước sạch tháng 05 năm 2019 tại Season Avenue như sau:</p>\n<p>-         Thời gian thu tiền : từ 08h00 ngày 16 tháng 06 năm 2016 đến hết 18h00 ngày 26 tháng 06 năm 2016.</p>\n<p>-         Địa điểm: Phòng làm việc Bộ phận Dịch vụ Khách hàng, Tầng 1,S1 – Season Avenue.</p>\n<p>Sau thời gian trên, nếu Cư dân chưa thanh toán tiền phí dịch vụ và tiền nước đầy đủ, Đơn vị quản lý dịch vụ sẽ tạm thời ngừng cung cấp dịch vụ đối với những Cư dân chưa thanh toán khoản phí nói trên.</p>\n<p>Mọi thắc mắc xin vui lòng liên hệ Bộ phận Dịch vụ Khách hàng qua số điện thoại: 043.657.4832 / 043.657.4833 hoặc hotline 0981773330</p>\n<p>Trân trọng thông báo.&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1558791305,1,1558791305,1559002033,5,23,9,1,35,3),(55,'Thông báo 27/05/2019','Trong mỗi gia đình chúng ta có lẽ không giấu nổi niềm vui, niềm hạnh phúc vỡ...','<p>Trong mỗi gia đình chúng ta có lẽ không giấu nổi niềm vui, niềm hạnh phúc vỡ òa khi chào đón thêm một thiên thần bé nhỏ, cung bậc cảm xúc đấy lại được nhân lên nhiều lần hơn nữa khi mẹ biết tin mình có cùng một lúc hai, ba… thiên thần</p>\n','{\"fileImageList\":[{\"uid\":\"