font-family: arial;\">Để đảm bảo cho công tác vận hành hệ thống thang máy tại các tòa nhà được ổn định và an toàn, phòng ngừa các sự cố về thang máy có thể xảy ra ảnh hưởng đến đời sống sinh hoạt hàng ngày của Cư dân. Công ty CP HUDLAND Thương mại và Dịch vụ phối hợp cùng đơn vị nhà thầu tiến hành kiểm tra và bảo dưỡng định kỳ thang máy tháng 6  năm 2018. Trong quá trình kiểm tra và bảo dưỡng thang máy Đơn vị dịch vụ sẽ tiến hành cắt luân phiên các thang máy của các tòa nhà. Thời gian tạm ngừng thang máy cụ thể như sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Tòa nhà GH3: Sáng 8h00-11h 00, chiều 13h30 đến 17h30 ngày 18 tháng 06 năm 2018</span>&nbsp;</p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1559286086884-5\",\"name\":\"1.png\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1559286355-1.png\"}],\"fileList\":[]}',0,NULL,NULL,NULL,1559286357,1,1559286357,1559286361,6,NULL,10,1,2,0),(60,'vxcvxc','vcxv\n','<p>vcxv</p>\n','{\"fileImageList\":[],\"fileList\":[]}',0,NULL,NULL,NULL,1559286627,1,1559286627,1559286661,6,NULL,10,1,2,0),(61,'!@#$%^&*&**','!@#$%^&amp;&amp;**\n','<p>!@#$%^&amp;&amp;**</p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1559286633209-3\",\"name\":\"2.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201905\\/1559286706-2.jpg\"}],\"fileList\":[{\"uid\":\"rc-upload-1559286633209-5\",\"name\":\"[SRS - WEB] T\\u00e0i li\\u1ec7u \\u0111\\u1eb7c t\\u1ea3 ph\\u1ea7n m\\u1ec1m .docx\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1559286713-srs---web-ti-liu-c-t-phn-mm.docx\"}]}',1,NULL,NULL,NULL,1559286715,1,1559286715,1559286721,6,NULL,10,1,1,0),(62,'!@#$%^&*()_','!@#$%^&amp;*()_\n','<p>!@#$%^&amp;*()_</p>\n','{\"fileImageList\":[],\"fileList\":[]}',0,NULL,NULL,NULL,1559286760,1,1559286760,1559286782,6,NULL,9,1,1,0),(63,'!@#$%^&*()!$%^&*()!@#$%^&','!@#$%^&amp;*()!$%^&amp;*()!@#$%^&amp;\n','<p>!@#$%