i_May.docx\",\"status\":\"done\",\"url\":\"\\/uploads\\/applications\\/201905\\/1559292789-cv_luong_thi_may.docx\"}]}',1,NULL,NULL,NULL,1559292790,1,1559292790,1559292841,6,NULL,11,1,1,0),(90,'THÔNG BÁO: (V/v: Thanh tra hệ thống PCCC tại tòa nhà Chung cư Sông Nhuệ)','THÔNG BÁO\n(V/v: Thanh tra hệ thống PCCC tại tòa nhà Chung cư Sông Nhuệ)\nKính...','<p><strong>THÔNG BÁO</strong></p>\n<p>(V/v: Thanh tra hệ thống PCCC tại tòa nhà Chung cư Sông Nhuệ)</p>\n<p><strong><em>Kính gửi: Toàn thể Quý cư dân nhà Chung cư Sông Nhuệ.</em></strong></p>\n<p>Ban quản lý nhà Chung cư Sông Nhuệ xin gửi tới Quý cư dân lời chào trân trọng và lời cảm ơn chân thành vì sự hợp tác và tin cậy đã dành cho chúng tôi trong thời gian qua.</p>\n<p>Thực hiện quyết định số 1534/QĐ-CAHN-PX05 ngày 04/05/2019 của Giám đốc CATP Hà Nội về thanh tra “Việc chấp hành các quy định của pháp luật về PCCC trong lĩnh vực đầu tư xây dựng các dự án công trình nhà chung cư cao tầng trên địa bàn thành phố Hà Nội”. Ban quản lý xin thông báo tới toàn thể Quý cư dân về lịch thanh tra PCCC của công an thành phố Hà Nội tại tòa nhà Chung cư Sông Nhuệ như sau:</p>\n<p><strong><em>Thời gian thanh tra:</em></strong> Ngày 05, 10/06/2019</p>\n<p>+ Sáng từ 08h30 - 11h</p>\n<p>+ Chiều từ 13h30 – 17h00</p>\n<p>Trong khoảng thời gian trên chúng tôi sẽ tiến hành kiểm tra hệ thống và test thử chuông báo cháy các tầng, dẫn đến chuông báo cháy sẽ kêu. Vậy BQL xin thông báo để Quý cư dân được biết.</p>\n<p><strong><em>Ban quản lý trân trọng thông báo!</em></strong></p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1559634933,2,1559634933,1559664280,18,1,2,1,7,5),(91,'Dự thảo Hồ sơ chào giá Quản lý vận hành CCSN','Theo kế hoạch CCSN sẽ tổ chức chào giá cạnh tranh gói thầu Quản lý vận hành...','<p>Theo kế hoạch CCSN sẽ tổ chức chào giá cạnh tranh gói thầu Quản lý vận hành CCSN. BQT gửi nội dung bản Dự thảo Chào giá cạnh tranh, rất mong sự đóng góp ý kiến các cư dân để BQT có thể bổ sung, chỉnh sửa và hoàn thiện Hồ sơ chào giá này tổ chức mời thầu, đặc biệt ý kiến của cư dân có chuyên môn trong các lĩnh vực có liên quan.</p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1559634032420-8\",\"name\":\"60753484_1171613003010766_7179510479235055616_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640598-60753484_1171613003010766_7179510479235055616_o.jpg\"},{\"uid\":\"rc-upload-1559634032420-10\",\"name\":\"60848791_1171613129677420_2969551795887538176_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640600-60848791_1171613129677420_2969551795887538176_o.jpg\"},{\"uid\":\"rc-upload-1559634032420-12\",\"name\":\"60849466_1171613236344076_3655494236683370496_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640604-60849466_1171613236344076_3655494236683370496_o.jpg\"},{\"uid\":\"rc-upload-1559634032420-14\",\"name\":\"60980539_1171613359677397_2413149283885776896_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640607-60980539_1171613359677397_2413149283885776896_o.jpg\"},{\"uid\":\"rc-upload-1559634032420-16\",\"name\":\"61099816_1171613066344093_588403033424003072_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640613-61099816_1171613066344093_588403033424003072_o.jpg\"},{\"uid\":\"rc-upload-1559634032420-18\",\"name\":\"61272629_1171613483010718_5416400505574260736_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640622-61272629_1171613483010718_5416400505574260736_o.jpg\"},{\"uid\":\"rc-upload-1559634032420-20\",\"name\":\"61348949_1171613293010737_946605955905224704_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640625-61348949_1171613293010737_946605955905224704_o.jpg\"},{\"uid\":\"rc-upload-1559634032420-22\",\"name\":\"61452052_1171613199677413_8548794620690038784_o.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559640628-61452052_1171613199677413_8548794620690038784_o.jpg\"}],\"fileList\":[]}',1,NULL,NULL,NULL,1559640629,2,1559640629,1559712691,18,13,2,1,7,6),(92,'Tổng kết tết thiếu nhi 01/06/2019','Mặc dù thời tiết không ủng hộ, nhưng với sự chuẩn bị chu đáo của tập...','<p><span style=\"color: rgb(29,33,41);background-color: rgb(255,255,255);font-size: 14px;font-family: system-ui, -apple-system, system-ui, \".SFNSText-Regular\", sans-serif;\">Mặc dù thời tiết không ủng hộ, nhưng với sự chuẩn bị chu đáo của tập thể BQT, cùng BQL và các thành viên của đơn vị tổ chức sự kiện, đêm vui tết thiếu nhi quốc tế 1/6/2019 toà nhà chung cư Sông Nhuệ đã thành công tốt đẹp. Bà con cư dân và các cháu thiếu nhi đã được thưởng thức các tiết mục múa hát do các cô trò Trường Ánh Hoa dàn dựng công phu và biểu diễn đầy sôi động. Bên cạnh đó là các tiết mục do các cháu toà nhà tham gia biểu diễn. Trong đêm vui các cháu thiếu nhi còn được thưởng thức các tiết mục ảo thuật đầy huyền bí, và tiết mục xiếc của Tề thiên đại thánh. Kết thúc đêm vui là màn múa hát tập thể của MC xinh đẹp Thanh Hằng cùng hàng trăm bé thơ. Đêm vui đã hạ màn nhưng niềm vui còn lan tỏa mãi. Chúc các cháu thiếu niên nhi đồng , những chủ nhân tương lai của Chung cư Sông Nhuệ bước vào một kỳ nghỉ hè đầy vui tươi và bổ ích.</span></p>\n','{\"fileImageList\":[{\"uid\":\"rc-upload-1559634032420-32\",\"name\":\"61507848_2638342199725656_6009742918892388352_n.jpg\",\"status\":\"done\",\"url\":\"\\/uploads\\/images\\/201906\\/1559643059-61507848_2638342199725656_6009742918892388352_n.jpg\"}],\"fileList\":[]}',1,NULL,NULL,NULL,1559643068,2,1559643068,1559720772,18,1,2,1,7,6),(93,'THÔNG BÁO VỀ VIỆC KIỂM TRA BẢO DƯỠNG THANG MÁY ĐỊNH KỲ','THÔNG BÁO\nVề việc kiểm tra bảo dưỡng thang máy định kỳ khu Luci Dream\nKính...','<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>THÔNG BÁO</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Về việc kiểm tra bảo dưỡng thang máy định kỳ khu Luci Dream</strong></span></p>\n<p style=\"text-align:center;\"><span style=\"color: rgb(40,40,40);background-color: transparent;font-size: 12px;font-family: arial;\"><strong>Kính gửi:</strong></span> <span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Toàn thể Qúy Cư dân Khu nhà Luci Dream</strong></span><strong> </strong></p>\n<p><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Đơn vị quản lý và vận hành Khu chung cư cao tầng Luci Dream</span> <span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"> trân trọng toàn thể cảm ơn toàn thể qúy Cư dân đã tin tưởng và sử dụng dịch vụ của Công ty HUDLANDTS Trong thời gian vừa qua.</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Để đảm bảo cho công tác vận hành thang máy tại các tòa nhà được vận hành ổn định và an toàn, đồng thời phòng ngừa các sự cố về thang máy có thể xảy ra gây ảnh hưởng đến đời sống sinh hoạt hàng ngày của Cư dân. Công ty HUDLANDTS phối hợp cùng đơn vị nhà thầu tiến hành kiểm tra và bảo dưỡng thang máy định kỳ tháng 4 năm 2018. Trong quá trình kiểm tra bảo dưỡng thang máy Đơn vị dịch vụ sẽ tiến hành cắt luôn phiên các thang máy của các tòa nhà. Thời gian cắt tạm ngừng thang máy cụ thể như sau:</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Tòa nhà S1: Sáng 8h00 – 1130, chiều: 13h00 đến 17h00 ngày 19/4/2018</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Tòa nhà S2: Sáng 8h00 – 1130, chiều: 13h00 đến 19h00 ngày 19/4/2018</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Trong quá trình tiến hành  kiểm tra và bảo dưỡng có thể ảnh hưởng tới đời sống sinh hoạt của  quý Cư dân. Đơn vị quản lý rất mong nhận được sự thông cảm và chia sẻ từ quý Cư dân</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\">Mọi sự đóng góp ý kiến của Qúy Cư dân xin liên hệ tới Bộ phận Dịch vụ Khách hàng tại tầng 1 tòa nhà GH4 hoặc liên hệ qua số điện thoại: 043 657 4833/ 043 657 4832, hotline Dịch vụ Khách hàng: 0981 773 330</span></p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(40,40,40);background-color: rgb(244,251,233);font-size: 12px;font-family: arial;\"><strong>Trân trọng thông báo!</strong></span>&nbsp;</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1559719170,3,1559719170,1559719202,26,NULL,17,1,200,0),(94,'HLV Park Hang-seo và mũi tên trúng nhiều đích trước Thái Lan','Để Việt Nam qua mặt ở nhiều giải đấu trong hai năm qua, Thái Lan khát khao...','<p><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Để Việt Nam qua mặt ở nhiều giải đấu trong hai năm qua, Thái Lan khát khao một cuộc thư hùng. Và thay vì né tránh, HLV Park Hang-seo chọn cách đối đầu trực diện. Ông chính là người tư vấn cho Liên đoàn bóng đá Việt Nam VFF nhận lời \"thách đấu\". Ngay cả khi Thái Lan đổi luật lệ để chắc chắn gặp Việt Nam, rồi sau đó chuyển địa điểm từ Bangkok lên Buriram, nhà cầm quân Hàn Quốc cũng không bất ngờ.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Có lẽ, chưa trận đấu nào ở cấp  đội tuyển quốc gia mà Thái Lan phải gồng người lên để thi đấu với Việt Nam như hôm qua. Nỗi e sợ từ thất bại 0-4 tại Mỹ Đình hồi tháng 3 là có thật. Nỗi ám ảnh về ngôi vị số một Đông Nam Á cũng có thật. Còn quá sớm để cho rằng Thái Lan đang lâm vào trạng thái \"chưa đá đã lo\" như Việt Nam trước đây. Nhưng, cách họ tiếp cận trận đấu bằng đội hình thấp, gia tăng liều lượng bạo lực khi tranh chấp, lui về rất nhanh sau mỗi pha tấn công bất thành mà không pressing tầm cao như thói quen trước đây cho thấy vị thế giữa hai làng cầu hàng đầu Đông Nam Á đã đổi chiều. Món đòn sút xa quen thuộc để tạo đột biến cũng không còn được sử dụng. Mối lo mất bóng và dính phản công đã khiến Thái Lan không thể chơi thứ bóng đá tốt nhất của họ.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Vì đây chỉ là một trận giao hữu, Thái Lan không ở trạng thái tốt nhất khi thiếu một vài trụ cột, HLV của họ cũng chỉ tạm quyền, nên chiến thắng 1-0 của Việt Nam vào phút cuối chưa thể dùng để phân tài cao - thấp. Nhưng Thành - Bại trong trận đấu này thì đã rõ. Việt Nam đã thành công trong việc xóa bỏ hoàn toàn những e ngại bé nhỏ còn sót lại đâu đó trong tâm trí về nỗi ám ảnh Thái Lan. Ngược lại, xứ Chùa Vàng đã thất bại trong cơ hội mà họ cố công tạo ra để tìm lại bản năng của một kẻ luôn buộc người khác phải khuất phục họ.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\"><strong>Sự khác biệt chắc chắn nằm ở HLV Park Hang-seo</strong>, người đã chủ động chọn cách đối đầu với Thái Lan để hoàn thành nốt công đoạn cuối cùng trong quá trình đưa bóng đá Việt Nam lên đẳng cấp mới. Không có cuộc đối đầu này, không đánh bại Thái Lan, thì chưa thể kết thúc một chu kỳ thành công để chuyển sang một giai đoạn tham vọng hơn.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Trong quá khứ, Việt Nam rất muốn phân tài với Thái Lan, nhưng ở các kỳ SEA Games hay AFF Cup, vẫn còn tâm lý \"né tránh\" nếu có cơ hội. Chính cái tâm lý nửa vời ấy đã khiến đa số các thế hệ đội tuyển Việt Nam dễ dàng đánh mất thế trận mỗi khi gặp bất lợi trong thi đấu.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Nhưng ở Chang Arena thì khác. Đoàn Văn Hậu, trẻ tuổi nhất trên sân, là cầu thủ có tần suất va chạm nhiều nhất với các cầu thủ Thái Lan, bao gồm cả tình huống \"gài\" cho Thitipan Puangchan tát vào mặt. Các pha bóng \"nhấc người\" rất tỉnh, chủ động né các pha vào đòn quyết liệt của Văn Hậu cho thấy sự chuẩn bị rất kỹ của HLV Park Hang-seo cho một trận đấu mà ông tin rằng Thái Lan rất máu ăn thua. Đó là lý do ông sử dụng dàn tiền vệ gồm Hùng Dũng – Tuấn Anh – Quang Hải để luân chuyển bóng và kiểm soát trận đấu, tránh rơi vào \"cái bẫy\" đá rát với lợi thế sân nhà và trọng tài của Thái Lan.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Cách ông đẩy Thái Lan vào sự tức giận và đánh mất lối chơi, còn thể hiện qua việc sử dụng Xuân Trường. Đó là người đang chơi bóng ngay tại Buriram, về lý thuyết, cũng là cầu thủ hay nhất của Việt Nam mà Thái Lan được biết. Nhưng ngôi sao đó chỉ được đưa vào phút cuối, như một hình thức thay người chiến thuật. Một ngôi sao khác mà Thái Lan biết rất rõ, Công Phượng, cũng chỉ vào sân từ ghế dự bị. Ngược lại, tiền đạo 34 tuổi Anh Đức bị chấn thương tưởng phải đi thẳng đến bệnh viện, vẫn được giữ lại trên sân. Một cầu thủ chưa đá phút nào ở V-League mùa này như Trọng Hoàng, lại xuất phát ngay từ đầu. Trọng Hoàng là một trong số ba tuyển thủ đang khoác áo Viettel, đội xếp gần cuối bảng V-League, đá chính trận này.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Nếu Thái Lan quyết tâm thắng Việt Nam, lẽ đương nhiên họ sẽ tìm hiểu kỹ từng con người của HLV Park Hang-seo, và cách dùng người của ông khiến cho họ nghĩ rằng Việt Nam không sử dụng đội hình tốt nhất cho cuộc đọ sức này. Điều đó, càng khiến Thái Lan bị tổn thương và tự đẩy bản thân vào một thế trận bất lợi. Những toan tính của HLV Park Hang-seo, thật kỳ lạ, chính xác đến từng chi tiết nhỏ nhất ở bàn thắng duy nhất của Anh Đức. Cái cách mà Thái Lan để thủng lưới, sẽ còn ám ảnh họ thêm một thời gian dài.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Một mũi tên, trúng nhiều đích. Sự thật là đội hình xuất phát của HLV Park không phải tốt nhất. Vấn đề nằm ở chỗ đó. Việt Nam thắng Thái Lan bằng chính yếu tố mà họ vẫn thường chiếm ưu thế khi đối đầu: tâm lý. Sự khác biệt lớn nhất từ trước đến nay giữa Việt Nam với Thái Lan, không hẳn là chất lượng con người mà là tâm thế vào trận. Ông Park đã chỉ ra rằng kể cả khi không được chuẩn bị tốt nhất, không có những ưu thế về sân bãi, khán giả... thì Việt Nam vẫn có thể đá trên cơ Thái Lan.</span></p>\n<p style=\"text-align:left;\"><span style=\"color: rgb(51,51,51);font-size: 14px;font-family: arial;\">Và nếu muốn, Việt Nam có thể hướng đến những mục tiêu xa hơn thay vì mãi nghĩ đến việc làm thế nào để được người Thái Lan công nhận vị thế của mình.</span><br></p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1559806005,2,1559806005,1559807382,18,1,2,1,7,5),(95,'Thông báo về việc cập nhật cho phần mềm cư dân trên mobile','Kính gửi quý cư dân,\nĐể nâng cao trải nghiệm và chăm sóc người dùng tốt...','<p><strong>Kính gửi quý cư dân</strong>,</p>\n<p>Để nâng cao trải nghiệm và chăm sóc người dùng tốt hơn, BQL đã nâng cấp ứng dụng Luci lên phiên bản mới và có hiệu lực từ <strong>0h ngày 07/06/2019.</strong></p>\n<p><strong>Nội dung cập nhật bao gồm:</strong></p>\n<p>- Thêm giới thiệu ứng dụng ở lần đầu cài đặt.</p>\n<p>- Thêm guide cho các tính năng cơ bản (vẫn đang tiếp tục phát triển).</p>\n<p>- Sửa lỗi giao diện &amp; logic hệ thống.</p>\n<p><strong>Hướng dẫn cập nhật: </strong></p>\n<p>- Với phiên bản ios, quý<span style=\"color: rgba(0,0,0,0.65);background-color: rgb(255,255,255);font-size: 14px;font-family: Quicksand, sans-serif;\"> cư dân</span> vui lòng truy cập vào ứng dụng testflight và cập nhật.</p>\n<p>- Với phiên bản android, quý<span style=\"color: rgba(0,0,0,0.65);background-color: rgb(255,255,255);font-size: 14px;font-family: Quicksand, sans-serif;\"> cư dân</span> vui lòng truy cập vào đường dẫn sau đây, tải và cài đặt: https://drive.google.com/open?id=1Ty5Kto0ec5AsqP88yr91rlyAkmDob4Tl</p>\n<p><strong>Chú ý: </strong>để việc cập nhật diễn ra thuận lợi, kính mong quý cư dân gỡ phiên bản ứng dụng đã cài đặt và làm theo hướng dẫn cập nhật ở trên.</p>\n<p>Những cư dân chưa thể cập nhật, xin vui lòng liên hệ đến Phòng hỗ trợ và Chăm sóc khách  hàng tại quầy lễ tân để được hỗ trợ kịp thời.&nbsp;</p>\n<p>Thông tin số điện thoại Phòng hỗ trợ và CSKH:</p>\n<p><ins>Mr Huy</ins>: <strong><em>097 8928230</em></strong></p>\n<p>Trân trọng.</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1559843285,2,1559843285,1559872405,18,9,7,1,7,4),(96,'Thông báo về việc cập nhật cho phần mềm cư dân trên mobile','Kính gửi quý cư dân,\nĐể nâng cao trải nghiệm và chăm sóc người dùng tốt...','<p><strong>Kính gửi quý cư dân,</strong></p>\n<p>Để nâng cao trải nghiệm và chăm sóc người dùng tốt hơn, BQL đã nâng cấp ứng dụng Luci lên phiên bản mới và có hiệu lực từ 0h ngày 07/06/2019.</p>\n<p><strong>Nội dung cập nhật bao gồm:</strong></p>\n<p>- Thêm giới thiệu ứng dụng ở lần đầu cài đặt.</p>\n<p>- Thêm guide cho các tính năng cơ bản (vẫn đang tiếp tục phát triển).</p>\n<p>- Sửa lỗi giao diện &amp; logic hệ thống.</p>\n<p><strong>Hướng dẫn cập nhật: </strong></p>\n<p>- Với phiên bản ios, quý cư dân vui lòng truy cập vào ứng dụng testflight và cập nhật.</p>\n<p>- Với phiên bản android, quý cư dân vui lòng truy cập vào đường dẫn sau đây, tải và cài đặt: https://drive.google.com/open?id=1Ty5Kto0ec5AsqP88yr91rlyAkmDob4Tl</p>\n<p><strong>Chú ý:</strong> để việc cập nhật diễn ra thuận lợi, kính mong quý cư dân gỡ phiên bản ứng dụng đã cài đặt và làm theo hướng dẫn cập nhật ở trên.</p>\n<p>Những cư dân chưa thể cập nhật, xin vui lòng liên hệ đến Phòng hỗ trợ và Chăm sóc khách  hàng tại quầy lễ tân để được hỗ trợ kịp thời.&nbsp;</p>\n<p>Thông tin số điện thoại Phòng hỗ trợ và CSKH:</p>\n<p><strong>Mr Huy: 097 8928230</strong></p>\n<p>Trân trọng.</p>\n','{\"fileImageList\":[],\"fileList\":[]}',1,NULL,NULL,NULL,1559844005,1,1559844005,1559867461,1,9,10,1,38,2);
