,1559271634,1,NULL),(8,'CODE1559294857','Kỹ thuật','Quản lý, vận hành, kiểm tra, bảo trì hệ thống kỹ thuật;','[\"BASIC\",\"REQUEST_CATEGORY_CREATE_UPDATE\",\"REQUEST_PROCESS\",\"REQUEST_CATEGORY_LIST\",\"REQUEST_LIST\"]',1559294857,1559294857,1,NULL),(9,'CODE1559294970','Lễ tân','Quản lý, chăm sóc Khách thuê, Cư dân, theo dõi Hợp đồng cho thuê, theo dõi công nợ, theo dõi gia hạn Hợp đồng cho thuê;','[\"BASIC\",\"REQUEST_CATEGORY_CREATE_UPDATE\",\"REQUEST_CONTACT_RESIDENT\",\"REQUEST_MANAGER_GROUPS_PROCESS_ADMIN\",\"REQUEST_PROCESS\"]',1559294970,1559544270,1,NULL),(10,NULL,'Trưởng BQL','Trưởng BQL','[\"ADMIN_PERMISSIONS_CREATE_UPDATE\",\"ADMIN_PERMISSIONS_LIST\",\"ANNOUNCE_CATEGORY_CREATE_UPDATE\",\"ANNOUNCE_CATEGORY_LIST\",\"ANNOUNCE_CREATE_UPDATE\",\"ANNOUNCE_LIST\",\"APARTMENT_CREATE_UPDATE\",\"APARTMENT_LIST\",\"BASIC\",\"FullPermissionRole\",\"MANAGEMENT-USER_CREATE_UPDATE\",\"MANAGEMENT-USER_LIST\",\"PostManagers\",\"REQUEST_CATEGORY_CREATE_UPDATE\",\"REQUEST_CATEGORY_LIST\",\"REQUEST_CONTACT_RESIDENT\",\"REQUEST_LIST\",\"REQUEST_MANAGER_GROUPS_PROCESS_ADMIN\",\"REQUEST_PROCESS\",\"RESIDENT_CREATE_UPDATE\",\"RESIDENT_LIST\",\"SETTING_BUILDING_AREA_CREATE_UPDATE\",\"SETTING_BUILDING_AREA_LIST\",\"SETTING_PLANE_UPDATE\",\"UserManagers\"]',1559621630,1559621630,3,NULL),(11,NULL,'Ban Quản Trị','Ban Quản Trị','[\"ANNOUNCE_CATEGORY_CREATE_UPDATE\",\"ANNOUNCE_CATEGORY_LIST\",\"ANNOUNCE_CREATE_UPDATE\",\"ANNOUNCE_LIST\",\"APARTMENT_CREATE_UPDATE\",\"APARTMENT_LIST\",\"BASIC\",\"PostManagers\",\"REQUEST_CATEGORY_LIST\",\"REQUEST_LIST\",\"RESIDENT_LIST\"]',1559623044,1559623044,3,NULL),(12,'CODE1559623868','Lễ tân',' Trực tại quầy lễ tân tòa nhà tại các vị trí được phân công, tiếp nhận các thông tin, phản hồi của khách hàng trực tiếp tại quầy hoặc qua phần mềm Building Care và xử lý theo quy trình, quy định của BQLTN.\n- Triển khai các hoạt động chăm sóc khách hàng theo kế hoạch và chỉ đạo của TBQLTN.\n- Tham gia xử lý khiếu nại và phản hồi khách hàng liên quan đến dịch vụ an ninh, an toàn, vệ sinh, kỹ thuật…tòa nhà.\n- Liên tục duy trì trật tự và vệ sinh trong sảnh Lễ tân.\n- Đề xuất các ý tưởng liên quan đến việc trang trí sảnh tòa nhà vào các dịp Noel, Tết.\n- Hỗ trợ tổ chức các buổi họp hoặc làm việc giữa Ban QL và Ban quản trị dân cư.\n- Khảo sát, cập nhật nguồn thông tin khách hàng tại tòa nhà\n- Các công việc khác do TB QLTN phân công.\n- Phối hợp chặt chẽ với các thành viên khác trong BQLTN để cung cấp dịch vụ quản lý đạt hiệu quả, chất lượng.\n- Phối hợp cùng TB QLTN/KST và các phòng ban chức năng khác của ĐXMB trong việc xử lý khủng hoảng xảy ra tại tòa nhà, bất động sản (nếu có).','[\"BASIC\",\"REQUEST_CATEGORY_CREATE_UPDATE\",\"REQUEST_MANAGER_GROUPS_PROCESS_ADMIN\",\"REQUEST_PROCESS\",\"REQUEST_CATEGORY_LIST\",\"REQUEST_CONTACT_RESIDENT\",\"REQUEST_LIST\",\"SETTING_BUILDING_AREA_LIST\",\"RESIDENT_LIST\",\"RESIDENT_CREATE_UPDATE\",\"MANAGEMENT-USER_LIST\",\"APARTMENT_LIST\",\"ANNOUNCE_CATEGORY_LIST\",\"ANNOUNCE_CATEGORY_CREATE_UPDATE\",\"ANNOUNCE_CREATE_UPDATE\",\"ANNOUNCE_LIST\"]',1559623868,1559623868,3,NULL),(13,'CODE1559623946','Kế toán','- Ra thông báo tiền Phí quản lý, tiền nước, Phí BTDP và các loại phí khác cho cư dân theo đặc thù của từng dự án.\n- Giải đáp các thắc mắc của cư dân liên quan đến các khoản phải thu của tòa nhà.\n- Thực hiện các báo cáo hàng tháng, hàng quý, hàng năm theo quy định của công ty.','[\"BASIC\",\"ANNOUNCE_CATEGORY_LIST\",\"ANNOUNCE_CATEGORY_CREATE_UPDATE\",\"ANNOUNCE_CREATE_UPDATE\",\"ANNOUNCE_LIST\",\"APARTMENT_LIST\",\"MANAGEMENT-USER_LIST\",\"REQUEST_CATEGORY_CREATE_UPDATE\",\"REQUEST_MANAGER_GROUPS_PROCESS_ADMIN\",\"REQUEST_CATEGORY_LIST\",\"REQUEST_PROCESS\",\"REQUEST_CONTACT_RESIDENT\",\"REQUEST_LIST\",\"RESIDENT_LIST\",\"SETTING_BUILDING_AREA_LIST\"]',1559623946,1559623946,3,NULL),(14,'CODE1559624038','Kỹ thuật','Quản lý vận hành thiết bị\nBảo dưỡng, rà soát, sửa trang thiết bị\nCung cấp giải pháp tiết kiệm năng lượng','[\"BASIC\",\"ANNOUNCE_CATEGORY_LIST\",\"ANNOUNCE_CREATE_UPDATE\",\"ANNOUNCE_LIST\",\"ANNOUNCE_CATEGORY_CREATE_UPDATE\",\"APARTMENT_LIST\",\"MANAGEMENT-USER_LIST\",\"REQUEST_CATEGORY_LIST\",\"REQUEST_LIST\",\"RESIDENT_LIST\",\"SETTING_BUILDING_AREA_LIST\"]',1559624038,1559624038,3,NULL),(15,'CODE1559631674','Ban quản trị','','[\"BASIC\",\"ADMIN_PERMISSIONS_CREATE_UPDATE\",\"ADMIN_PERMISSIONS_LIST\",\"ANNOUNCE_CATEGORY_CREATE_UPDATE\",\"ANNOUNCE_CATEGORY_LIST\",\"ANNOUNCE_CREATE_UPDATE\",\"ANNOUNCE_LIST\",\"APARTMENT_CREATE_UPDATE\",\"APARTMENT_LIST\",\"FullPermissionRole\",\"MANAGEMENT-USER_CREATE_UPDATE\",\"MANAGEMENT-USER_LIST\",\"PostManagers\",\"REQUEST_CATEGORY_CREATE_UPDATE\",\"REQUEST_CATEGORY_LIST\",\"REQUEST_CONTACT_RESIDENT\",\"REQUEST_LIST\",\"REQUEST_MANAGER_GROUPS_PROCESS_ADMIN\",\"REQUEST_PROCESS\",\"RESIDENT_CREATE_UPDATE\",\"RESIDENT_LIST\",\"SETTING_BUILDING_AREA_CREATE_UPDATE\",\"SETTING_BUILDING_AREA_LIST\",\"SETTING_PLANE_UPDATE\",\"UserManagers\"]',1559631674,1559631674,1,NULL),(16,'CODE1559631709','Kế toán','','[\"BASIC\",\"PostManagers\",\"RESIDENT_CREATE_UPDATE\",\"RESIDENT_LIST\",\"APARTMENT_CREATE_UPDATE\",\"APARTMENT_LIST\",\"ANNOUNCE_CATEGORY_CREATE_UPDATE\",\"ANNOUNCE_CATEGORY_LIST\",\"ANNOUNCE_CREATE_UPDATE\",\"ANNOUNCE_LIST\"]',1559631709,1559631709,1,NULL),(19,'CODE1559720435','    sdfsdsd','','[\"BASIC\"]',1559720435,1559720435,1,NULL),(20,'CODE1559720736','fhgdfh','Trong bài viết trên Facebook hôm 31/5 nhằm chia buồn việc cựu thủ tướng Thái Lan Prem Tinsulanonda qua đời, Thủ tướng Singapore Lý Hiển Long có những phát biểu đề cập tới mối quan hệ giữa Việt Nam với Campuchia và ASEAN trong thập niên 1980.\nÔng Lý nói rằng giai đoạn lãnh đạo của ông Prem trùng với thời điểm mà ông gọi là \"sự xâm lược của Việt Nam với Campuchia và chính phủ Campuchia thay thế Khmer Đỏ\". Ông còn nói rằng Thủ tướng Thái Lan Prem đã phối hợp với các đối tác ASEAN để chống lại \"sự chiếm đóng\" của Việt Nam. \nNgười phát ngôn Bộ Ngoại giao Lê Thị Thu Hằng hôm 4/6 cho hay Việt Nam lấy làm tiếc khi đã có một số nội dung phát biểu phản ánh không khách quan thực tế lịch sử, gây tác động không tốt đến dư luận. Bộ Ngoại giao Việt Nam đã trao đổi với Bộ Ngoại giao Singapore về vấn đề này.\nNgười phát ngôn khẳng định đóng góp và hy sinh của Việt Nam trong việc cùng nhân dân Campuchia chấm dứt tội ác diệt chủng của Khmer Đỏ là sự thật đã được thừa nhận rộng rãi. Ngày 16/11/2018, Toà án đặc biệt của Campuchia (ECCC) đã ra phán quyết về tội ác diệt chủng chống nhân loại của Khmer Đỏ, trả lại công bằng cho các nạn nhân, được Liên Hợp Quốc và cộng đồng quốc tế hoan nghênh.\n','[\"BASIC\",\"ANNOUNCE_CREATE_UPDATE\"]',1559720736,1559720736,1,NULL);
