INSERT INTO `building_area` VALUES (1,'Tòa S2','Sự lựa chọn hoàn hảo của các gia đình trẻ, dự án đang gây “sốt” với khách hàng và nhiều nhà đầu tư tại cửa ngõ phía Tây Nam thủ đô. Để đáp ứng nhu cầu của thị trường và mong mỏng của khách hàng, đầu tháng 4/2016 này, chủ đầu tư Capital Land tiếp tục cho ra mắt những căn hộ đầu tiên của tòa S2 Seasons Avenue','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1558768189-lang-viet-kieu-chau-au-1.png\"}',0,0,1,NULL,1557889163,1558779906,1,20,NULL),(2,'Tòa S1','Tòa S1 là tòa có vị trí đẹp nhất trong tổng thể dự án Seasons Avenue Mỗ Lao bởi sở hữu 4 mặt thoáng, một mặt nhìn về phía Hà Nội, 1 mặt hướng về phía Hà Đông và 1 mặt nhìn toàn cảnh khuôn viên bể bơi. Với chính sách ưu đãi mới vô cùng hấp dẫn, tòa Mùa Xuân S1 sẽ là tòa căn hộ “HOT” nhất trong tháng 7 này tại thị trường BĐS Hà Nội.','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1558765885-group-343.png\"}',0,0,1,NULL,1557889629,1558779886,1,20,NULL),(3,'Sinh hoạt chung','Khu sinh hoạt chung của cư dân: vui chơi, tổ chức BBQ,  đi bộ, ...',NULL,0,1,1,NULL,1557889777,1558779873,1,20,NULL),(4,'Tầng 1','Là tầng thương mại','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1558768228-tttm-aeon-mall.jpg\"}',0,0,1,1,1557893035,1558768229,1,6,NULL),(5,'Tầng 2','Cho thuê văn phòng','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1558768257-modem-wifi-bang-tan-kep-cua-fpt-768x512.jpg\"}',0,0,1,1,1557893035,1558768258,1,6,NULL),(6,'SDFSDF','',NULL,0,0,1,4,1557893699,1557893699,1,1,NULL),(7,'Tầng 3','',NULL,0,0,1,1,1557894290,1558428073,1,1,NULL),(8,'Tầng hầm B1','Tầng hầm dành riêng cho gửi xe ô tô của cư dân','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1558766143-ti-xung-2.jpg\"}',0,0,1,2,1557894525,1558771331,1,6,NULL),(9,'Tầng hầm B2','Tầng hầm dành cho gửi xe máy của cư dân','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1558766177-chot-4-1426522720882.jpg\"}',0,0,1,2,1557894536,1558771313,1,6,NULL),(10,'Tầng 1','Trung tâm thương mại','{\"imageUrl\":\"\\/uploads\\/images\\