ở vòng loại U23 châu Á đầu năm 2019. \"Đối thủ có là ai đi nữa cũng không khiến chúng tôi sợ hãi. Tôi luôn dặn các học trò như vậy, dù gặp Nhật Bản và Hàn Quốc. Chúng tôi chẳng phải sợ bất cứ đối thủ nào\".\n\"Thái Lan là đối thủ mạnh, nhưng tuyển Việt Nam cũng đã nỗ lực rất nhiều để vô địch AFF Cup năm ngoái. Chúng tôi luôn nỗ lực để tiến bộ hơn. Tôi luôn dặn cầu thủ rằng, dù kết quả ngày mai có thế nào, thắng hoặc thua, điều quan trọng là chúng tôi học được những gì. Chúng tôi cần chơi tốt nhất với khả năng\".\nTrong buổi họp báo chiều 4/6, HLV Park Hang-seo và đội trưởng Quế Ngọc Hải nhận nhiều câu hỏi về Thái Lan - đối thủ được xem là kình địch của bóng đá Việt Nam ở Đông Nam Á. Tuy nhiên, cả hai người đều khẳng định dù gặp Thái Lan hay đối thủ nào đi nữa, đội đều vào cuộc tự tin, sau những giải đấu thành công ở tầm châu lục như Asiad hay Asian Cup.\n',NULL,0,0,1,NULL,1559642191,1559642191,6,6,NULL),(85,'xcvxcbv','xcbxcb','{\"imageUrl\":\"\\/uploads\\/images\\/201906\\/1559642683-20181228_202137.jpg\"}',0,1,1,84,1559642807,1559642814,6,6,'a/'),(86,'dfgd','bdfgdfgsdf',NULL,0,0,1,NULL,1559642840,1559642850,6,6,NULL),(87,'Từ kí tự 31 trở đi tự động strim, không cho nhập nữa','xsf',NULL,0,0,1,86,1559699056,1559699056,6,6,'dfgd/'),(88,'a','Trong bài viết trên Facebook hôm 31/5 nhằm chia buồn việc cựu thủ tướng Thái Lan Prem Tinsulanonda qua đời, Thủ tướng Singapore Lý Hiển Long có những phát biểu đề cập tới mối quan hệ giữa Việt Nam với Campuchia và ASEAN trong thập niên 1980.\n\nÔng Lý nói rằng giai đoạn lãnh đạo của ông Prem trùng với thời điểm mà ông gọi là \"sự xâm lược của Việt Nam với Campuchia và chính phủ Campuchia thay thế Khmer Đỏ\". Ông còn nói rằng Thủ tướng Thái Lan Prem đã phối hợp với các đối tác ASEAN để chống lại \"sự chiếm đóng\" của Việt Nam. \n\nNgười phát ngôn Bộ Ngoại giao Lê Thị Thu Hằng hôm 4/6 cho hay Việt Nam lấy làm tiếc khi đã có một số nội dung phát biểu phản ánh không khách quan thực tế lịch sử, gây tác động không tốt đến dư luận. Bộ Ngoại giao Việt Nam đã trao đổi với Bộ Ngoại giao Singapore về vấn đề này.\n\nNgười phát ngôn khẳng định đóng góp và hy sinh của Việt Nam trong việc cùng nhân dân Campuchia chấm dứt tội ác diệt chủng của Khmer Đỏ là sự thật đã được thừa nhận rộng rãi. Ngày 16/11/2018, Toà án đặc biệt của Campuchia (ECCC) đã ra phán quyết về tội ác diệt chủng chống nhân loại của Khmer Đỏ, trả lại công bằng cho các nạn nhân, được Liên Hợp Quốc và cộng đồng quốc tế hoan nghênh.',NULL,0,0,1,84,1559700337,1559700337,6,6,'a/'),(89,'xvcxcv','xcv',NULL,0,1,1,84,1559700899,1559701405,6,6,'a/');
