INSERT INTO `building_cluster` VALUES (1,'SEASON AVENUA','https://demo.staging.building.luci.vn','admin@luci.vn','0968 980 280 ','Tọa lạc phía Tây Nam Hà Nội, thuộc khu CT09, Cổ Ngựa, KĐT Mỗ Lao, Hà Đông - Cho nhập string không quá 100 kí tự kể cả khoảng trắng','','Seasons Avenue – Đại lộ bốn mùa là một dự án tiếp theo của chủ đầu tư Capital Land được khách hàng đánh giá cao bởi chất lượng, tiến độ và tiện ích vượt trội so với những dự án cùng phân khúc hay khu vực.\r\n\r\nSau những nỗ lực không ngừng của chủ đầu tư cùng đơn vị thi công, hiện tại dự án đã chính thức cất nóc cả 4 tòa căn hộ, trong đó S1 Seasons Avenue là tòa sẽ được bàn giao sớm nhất. Đây chính là thời điểm vàng để quý khách hàng lựa chọn và đặt cọc những căn hộ đẹp nhất tại dự án, hãy đăng ký ngay với chúng tôi để nhận được nhiều ưu đãi hấp dẫn.','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1558779811-phi-cnh-seasons-avenue.jpg\"}',1,'','',1,0,NULL,1559640304,NULL,6,'be8acb11-7202-44cb-941f-9662223db24a','YTkwMjhhNjgtZGY3YS00MjU3LTk5NWItMWRmZGJiZThiM2Uy'),(2,'Luci Labs','http://localhost:3000','support@luci.vn','0978928230','Tòa nhà Luci Labs','','Tòa nhà Luci Labs phát triển những dự án X','{\"imageUrl\":\"\\/uploads\\/images\\/201905\\/1559203581-11111-copy.jpg\"}',1,'','',1,0,1558454757,1559617888,NULL,1,'2b7a2903-f0bd-4592-905b-657a774ee4b9','NDRmOGZiNmUtM2FkNS00MTFhLThhNzItOGUxNzM2YzVmNjgw'),(3,'Luci Dream','https://dream.staging.building.luci.vn','support@luci.vn','0978928230','Số 1, Luci Smart City, Mỗ Lao, Hà Nội','','',NULL,1,'','',1,0,1559614301,1559623405,1,26,'6ed0ed79-ed65-47e6-a90b-5ad4ac1c3f02','ZWQ5N2EwNDctYmE2OS00YmZhLTk3MjAtZjY3YjAwMzgxOTNh');
