--
-- Table structure for table `management_user`
--

DROP TABLE IF EXISTS `management_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `management_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `password` varchar(64) NOT NULL,
  `email` varchar(64) NOT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `first_name` varchar(64) DEFAULT NULL,
  `last_name` varchar(64) DEFAULT NULL,
  `avatar` varchar(255) DEFAULT NULL,
  `auth_key` varchar(255) DEFAULT NULL,
  `gender` int(1) DEFAULT 0 COMMENT 'giới tính : 0 - chưa xác định, 1 - nam, 2 - nữ',
  `birthday` int(11) DEFAULT NULL COMMENT 'ngày sinh',
  `parent_id` int(11) DEFAULT NULL,
  `status` smallint(6) NOT NULL DEFAULT 0 COMMENT '0 : chưa kích hoạt, 1 : đã kích hoạt, 2 : bị khóa',
  `status_verify_phone` smallint(6) DEFAULT NULL COMMENT '0 - chưa xác thực , 1 đã xác thực',
  `status_verify_email` smallint(6) DEFAULT NULL COMMENT '0 - chưa xác thực , 1 đã xác thực',
  `auth_group_id` int(11) DEFAULT NULL,
  `is_deleted` int(1) DEFAULT 0 COMMENT '0 : chưa xóa, 1 : đã xóa',
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `building_cluster_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `idx-management_user-auth_group_id` (`auth_group_id`),
  KEY `idx-management_user-is_deleted` (`is_deleted`),
  KEY `idx-management_user-parent_id` (`parent_id`),
  KEY `idx-management_user-status` (`status`),
  KEY `idx-management_user-status_verify_email` (`status_verify_email`),
  KEY `idx-management_user-status_verify_phone` (`status_verify_phone`),
  KEY `idx-management_user-building_cluster_id` (`building_cluster_id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

