INSERT INTO `service` VALUES (2,'Dịch vụ nước sinh hoạt','Công ty TNHH một thành viên nước sạch Hà Nội có 100% vốn Nhà nước, trực tiếp tổ chức hoạt động sản xuất kinh doanh, thực hiện một số quyền và nghĩa vụ của chủ sở hữu đối với phần vốn Nhà nước đầu tư vào các công ty thành viên, Công ty con, Công ty liên do','/uploads/images/201905/1559274618-nuoc-sach-3.jpg',1,1559274480,1559274620,1,0,0,'/water',NULL),(3,'Dịch vụ trông giữ xe máy','Nhu cầu sử dụng phương tiện đi lại ngày càng cao, xe máy được người dân ưa chuộng và sử dụng làm phương tiện đi lại hàng ngày. Tuy nhiên khi đến dịp lễ tết, khi nhu cầu đi lại tăng lên thì khó mà có thể tìm được nơi nào ưng ý an tâm gửi xe để dạo chơi, tham quan. Một số bãi xe tự phát mọc khắp các đường phố với các mức giá trên trời hoặc bãi xe chật chội, xe không được sắp xếp trật tự. Ngoài ra còn có trường hợp, người giữ xe luộc phụ tùng của khách hàng ngay tại bãi,…\r\nVới tình hình đó, chúng tôi cho ra đời dịch vụ trông giữ xe với đội ngũ nhân viên phục vụ có uy tính với thái độ phục vụ có thể khiến cho khách hàng vừa lòng.\r\n+ Giữ xe ô tô, xe máy trong khuôn viên bãi giữ xe.\r\n+ Sắp xếp, phân loại các xe theo lô và hàng khác nhau để dễ kiểm soát\r\n+ Thường xuyên tuần tra ngăn chặn những hành vi trộm cắp xe và phụ tùng xe','/uploads/images/201906/1559748247-dauthauhopdongbaigiuxe.jpg',1,1559748250,1559748250,0,0,0,'/moto-packing','icRideParking'),(4,'Dịch vụ quản lý chung cư','Xã hội ngày càng phát triển, điều kiện sống không ngừng được nâng cao, điều này đòi hỏi con người phải tốn thêm ngân sách để chi trả cho những tiện ích tuyệt vời của cuộc sống. Và ở chung cư cũng vậy, để có được môi trường sống tốt nhất, với những tiện ích tuyệt vời nhất, an ninh đảm bảo nhất, bạn cũng cần phải bỏ ra một khoản chi phí nhất định có tên phí quản lý nhà ở chung cư. Chi phí quản lý chung cư bao gồm:\r\n\r\nPhí an ninh bảo vệ\r\nPhí dọn dẹp vệ sinh khu vực chung như hành lang, đường nội bộ…\r\nPhí sử dụng hồ bơi\r\nTiền trả nước tưới cây trong khuôn viên chung cư\r\nTiền điện dành cho khu vực thang máy\r\nPhí sửa chữa các thiết bị trong khu vực chung\r\nPhí lắp đặt hệ thống phòng cháy chữa cháy…','/uploads/images/201906/1559748898-43cbc86dc7de24807dcf.jpg',1,1559748870,1559748900,2,0,0,'/apartment-fee',''),(5,'Dịch vụ tiện ích miễn phí','– Dịch vụ internet: Viettel, VNPT (Khách hàng tự đăng ký sử dụng dịch vụ với nhà mạng).\r\n\r\n– Đơn vị cung cấp dịch vụ điện thoại/fax: Viettel, VNPT (Khách hàng tự đăng ký sử dụng dịch vụ với nhà mạng).\r\n\r\n– Đơn vị cung cấp nguồn điện lưới: Sử dụng điện từ trạm điện lưới Hà Đông thông qua trạm trung thế độc lập của tòa nhà có công suất 1600 KVA.\r\n\r\n– Nguồn điện và năng lực cung cấp điện dự phòng, thời gian chuyển đổi, địa điểm đặt máy nổ (nếu có), kế hoạch bảo trì bảo dưỡng máy nổ, kế hoạch chạy thử, kiểm tra định kỳ, v.v.\r\n\r\nSử dụng máy phát điện Misumitshi công suất 2030 KVA có thể hoạt động cung cấp điện cho cả tòa nhà tối đa 72 giờ khi mất điện. Khi mất điện lưới, hệ thống tự khởi động sau 30 giây.\r\nMáy phát điện được kiểm tra định kỳ 1 tuần 2 lần. Chạy 1 tuần 1 lần không tải, 2 tuần 1 lần có tải, được bảo dưỡng sau khi máy chạy được 200 giờ.\r\nMáy được đặt ngoài tòa nhà, cùng khu vực với trạm trung thế, và trạm cấp nước.\r\n– Hệ thống an ninh (bảo vệ, camera giám sát, thẻ ra vào, đăng ký ra vào, v.v.)\r\n\r\nTòa nhà được bảo vệ bởi 19 nhân viên an ninh và hệ thống camera giám sát 24/7. Bảo vệ tuần tra liên tục, đứng chốt thường xuyên các điểm trên toàn nhà.\r\nCamera vòng ngoài tòa nhà, khu vực công cộng, lối ra vào tòa nhà. Lắp đặt 4 camera mỗi tầng.\r\nPhải đăng ký nhận thẻ ra vào tòa nhà tại quầy lễ tân, nếu không có thẻ sẽ không được đi lại trong tòa nhà.\r\n– Hệ thống điều hòa, hút ẩm (của hãng nào, đời thứ mấy): Hệ thống điều hòa, hút ẩm trung tâm Intelligent Manager VRV3-DAIKIN Invester hai chiều, đảm bảo điều hòa nhiệt độ và hút ẩm cho hệ thống văn phòng tòa nhà.\r\n\r\n','/uploads/images/201906/1559789270-dich-vu-tien-ich-tai-rivera-park-ha-noi.jpg',1,1559789556,1559789663,2,1,0,'/utility-free','icRideParking');
